import React, { useState, useEffect } from 'react'
import { useNavigate } from 'react-router-dom';
import axios from './api/axios'
const CATALOG_URL = '/v1/catalog';

const CatalogList = () => {
    const [catalog, setCatalog] = useState([])
    const navigate = useNavigate()
    useEffect(() => {
        catList()
    }, [])

    const catList = async () => {
        // const response = await axios.get(CATALOG_URL)
        const response = [{
            "id": 1,
            "itemName": "abc", "description": "desc", "amount": 100, "imageUrl": ""
        }]
        setCatalog(response)

        console.log('cat', catalog);
    }

    const insertToCatalog=()=>{
        navigate('/catalog-add')
    }
    const navigateToCart=()=>{
        navigate('/kart')
    }

    const addToCart = (id) => {
        console.log('id', id);
    }
    const columnView = (element) => {
       return (<div className="col-md-2 col" key={element.id}>
            <p>{element.id}</p>
            <div className="card" style={{ width: "5rem;" }}>
                <img src={element?.imageUrl} className="img" alt="" />
                <div className="card-body">
                    <h5 className="card-title">{element?.amount}</h5>
                    <p className="card-text">{element?.itemName}</p>
                    <p className="card-text">{element?.description}</p>
                    <a onClick={addToCart(element?.id)} className="btn btn-outline-primary">Add To Cart</a>
                </div>
            </div>
        </div>)
    }
    return (
        <div className='container-fluid cat'>
            <div className="row">
                <div className="col-md-12 d-flex justify-content-end">
                <a onClick={()=>insertToCatalog()} className='btn btn-outline-primary me-2'>Add Catalog Item</a>
                <a onClick={()=>navigateToCart()} className='btn btn-outline-primary'>Cart</a>
                </div>
                {
                    catalog && catalog.map((element) => {
                        console.log('element', element);
                        columnView(element)
                    })
                }

            </div>
        </div>
    )
}

export default CatalogList
